import React from 'react';

import { Container, Filter, Products, List } from './styles';

import Card from '../Card'

function ProductsList() {
  return (
    <Container>
        <Filter>
            <input placeholder="buscar..." />
        </Filter>
        <Products>
            <List>
              <Card />
            </List>
        </Products>
    </Container>
  )
}

export default ProductsList;
